#include <stdio.h>

int main(){
    unsigned long long int productTmp, product = 0;
    int i, j;
    char number[] = "";
    //printf("7, 6, 1\n");
    //printf("%d, %d, %d\n", number[0]-48, number[3]-48, number[10]-48);

    for(i = 0; i < 1000; i++){
        productTmp = 1;
        for(j = 0; j < 13; j++){
            //printf("product = %li, number[%d+%d]-48 = %d\n", productTmp, i, j, number[i+j]-48);
            productTmp *= number[i+j]-48;
        }
        if(productTmp > product){
            product = productTmp;
        }
    }

    printf("%lld \n", product);
    return 0;
}
